import axios from 'axios'
import React, { useEffect, useState } from 'react'
const ListJ = () => {
    const [myusers,setmyuser]=useState([])
    useEffect(function(){
      axios.get('http://localhost:1234/Users/getAll').then(v=>{setmyuser(v.data)})
    },[])
    const log=(id,name)=>{
      axios.get(`http://localhost:1234/Users/getbyid/${id}/${name}`).then(j=>setmyuser(j.data))
    }
  return <div>
    {myusers?.map((n)=>(<p>{n.name}--{n.id}--{n.adress}--{n.phone}--{n.isMnager}--{n.favoriteRecipe}</p>))}</div>
  
}

export default ListJ
